DROP TRIGGER IF EXISTS `trig_Task_A_D`;
DELIMITER ;;
CREATE TRIGGER `trig_Task_A_D` AFTER DELETE ON `task` FOR EACH ROW BEGIN
    INSERT hsTask(lTaskID,sTaskName,state,sSubmitter,sTaskDesc,iHBBreakSecs,lJobOvertimeSecs,planMode,
                lTime2Exec,lSubmitTime,seqCN,lStartSecs,lEndSecs,memo)
        VALUES(old.lTaskID,old.sTaskName,old.state,old.sSubmitter,old.sTaskDesc,old.iHBBreakSecs,old.lJobOvertimeSecs,old.planMode,
                old.lTime2Exec,old.lSubmitTime,old.seqCN,old.lStartSecs,old.lEndSecs,old.memo);
    INSERT hsTaskResult(lTaskID,lJobID,bsResult)
        SELECT lTaskID,lJobID,bsResult
            FROM TaskResult
            WHERE lTaskID=old.lTaskID;
    INSERT hsTaskAppFile(lTaskID,AllOrDist,sFileName,type,sSrcPath,sDstPath,sMD5,bDLAlways)
        SELECT lTaskID,AllOrDist,sFileName,type,sSrcPath,sDstPath,sMD5,bDLAlways
            FROM TaskAppFile
            WHERE lTaskID=old.lTaskID;
    INSERT hsTaskAppPara(lTaskID,sAppName,appType,sExecCmd,sWorkDir,lOPS,sVerifySo,sVerifyIni,sAppScriptTemplate)
        SELECT lTaskID,sAppName,appType,sExecCmd,sWorkDir,lOPS,sVerifySo,sVerifyIni,sAppScriptTemplate
            FROM TaskAppPara
            WHERE lTaskID=old.lTaskID;




    INSERT hsTaskAlarmInfo(lTaskID,lJobID,iLevel,lOccurTime,sDesc)
        SELECT lTaskID,lJobID,iLevel,lOccurTime,sDesc
            FROM TaskAlarmInfo
            WHERE lTaskID=old.lTaskID;
    DELETE FROM TaskAlarmInfo WHERE lTaskID=old.lTaskID;
    DELETE FROM JobInfo       WHERE lTaskID=old.lTaskID;
    DELETE FROM TaskAppPara   WHERE lTaskID=old.lTaskID;
    DELETE FROM TaskAppFile   WHERE lTaskID=old.lTaskID;
    DELETE FROM TaskResult    WHERE lTaskID=old.lTaskID;
    DELETE FROM TaskResult WHERE lTaskID NOT IN(SELECT DISTINCT lTaskID FROM Task);
    DELETE FROM TaskAppPara WHERE lTaskID NOT IN(SELECT DISTINCT lTaskID FROM Task);
    DELETE FROM TaskAppFile WHERE lTaskID NOT IN(SELECT DISTINCT lTaskID FROM Task);
    DELETE FROM JobInfo WHERE lTaskID NOT IN(SELECT DISTINCT lTaskID FROM Task);
    DELETE FROM TaskAlarmInfo WHERE lTaskID NOT IN(SELECT DISTINCT lTaskID FROM Task);
END
;;
DELIMITER ;
